    return a + b
  }

  return (
    <div className="App">
      <header className="App-header">
          <h1>Olá marilene</h1>
          <h2>Adicionando variaveis</h2>
          <p>Olá meu nome é: {upper_name} </p>
          <p>Soma: {sum(1, 2)}</p>
      </header>
    </div>
  );
}

export default App;
